%flink

import org.apache.flink.ml.math.Breeze._
import org.apache.flink.ml.regression.SimpleLeastSquaresRegression
import breeze.linalg._

def predictMinMax(input: DataSet[LabeledVector], sls: SimpleLeastSquaresRegression): Unit = {
    val minTV = input.map(x => x.vector.asBreeze).reduce{
        (left, right) => min(left, right)
    }.map(x => x.fromBreeze)

    val maxTV = input.map(x => x.vector.asBreeze).reduce{
        (left, right) => max(left, right)
    }.map(x => x.fromBreeze)

    val minPredict = sls.predict(minTV).collect()(0)
    val maxPredict = sls.predict(maxTV).collect()(0)

    z.put("featureMin", minPredict._1.asInstanceOf[org.apache.flink.ml.math.DenseVector].data)
    z.put("minPredict", minPredict._2:java.lang.Double)
    z.put("featureMax", maxPredict._1.asInstanceOf[org.apache.flink.ml.math.DenseVector].data)
    z.put("maxPredict", maxPredict._2:java.lang.Double)   
}
